import React from "react";

import fechas from "./fechas";
import "../lineaEstilos.css";

const LineaFechas = () => {
    return (
        <>
            <tbody>
                {fechas.map((user) => (
                    <tr>
                        <th scope="row">{user["Fechas"]}</th>
                        <td></td>
                        <td>Ver</td>
                        <td></td>

                    </tr>
                ))}
            </tbody>
        </>
    );
};

export default LineaFechas;
